import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import JobsCards from '../JobsCards';
import ProjectsCards from '../ProjectsCards';

function Home() {
  return (
    <>
      <HeroSection />
      <JobsCards />
      <ProjectsCards />
      <Footer />
    </>
  );
}

export default Home;
